  ?movie wdt:P161 wd:Q6107 ; wdt:P31 wd:Q11424 .
  FILTER ( ?movie != wd:Q749899 && ?movie != wd:Q7853467 && ?movie != wd:Q11704796 && ?movie != wd:Q5501177 )
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?movie WHERE {
  ?movie wdt:P161 wd:Q169982 ; wdt:P31 / wdt:P279 * wd:Q11424 .
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?language ?label WHERE {
  wd:Q145 wdt:P2936 ?language .
  OPTIONAL {
    ?language rdfs:label ?label .
    FILTER ( LANG( ?label ) = "en" )
  }
  FILTER ( ?language IN ( wd:Q1860 , wd:Q9309 , wd:Q9314 , wd:Q9142 ) )
}

